import './App.css';
import pokemons from './data';
import Pokedex from './pokedex';

function App() {
  return (
    <div className="App">
      <h1 id='title'>Pokedex</h1>
      {pokemons.map((pokemon) => <Pokedex name={pokemon.name} type={pokemon.type} weight={pokemon.averageWeight} image={pokemon.image} />)}
    </div>
  );
}

export default App;
